    def print_tree(self, node: TreeNode, par_val: str, last_turn: str):

        if node:
            path_to_here = par_val + last_turn + str(node.val)
            print(path_to_here)
            self.print_tree(node.left,  str(node.val) , 'L')
            self.print_tree(node.right,  str(node.val), 'R')
            return path_to_here


    def bst_from_list(self, tree_list: []) -> TreeNode:

        if len(tree_list) == 0:
            return None

        root = TreeNode(tree_list[0])

        for i in range(1,len(tree_list)):
            self.insert_tree_node(root,tree_list[i])

        return root

    def insert_tree_node(self, root : TreeNode, val: int) -> TreeNode:

        if val > root.val:
            if root.right == None:
                root.right = TreeNode(val)
            else:
                self.insert_tree_node(root.right, val)
        elif val < root.val:
            if root.left == None:
                root.left = TreeNode(val)
            else:
                self.insert_tree_node(root.left, val)

        return root


    def compare_trees(self, tree1: TreeNode, tree2: TreeNode) -> bool:

        compare_result = True

        def compare(node1, node2):

            if node1 != None and node2 != None:
                if node1.left == node2.left and node1.right == node2.right and node1.val == node2.val:
                    compare(node1.left, node2.left)
                    compare(node1.right, node2.right)
                    return
            if node1 == None and node2 == None:
                return

            compare_result = False
            return

        compare(tree1, tree2)
        return compare_result

